if mibBuilder.loadTexts: mlpppLSapLcTransmitACCMap.setDescription("Determines the Asynchronous Control Character Map (ACC) that the local PPP link proposes for use on its transmit side. The local's proposed ACC will be negotiated with the remote's proposed ACC. The result of the negotiation is displayed in mlpppLSapLsPeerToLocalACCMap in the mlpppLSapLsTable. The ACCMap maps the first 32 ASCII control characters (numbered 0 to 31). The map allows datagrams traveling over a PPP link to be transparent to all intermediate devices such as modems. The value of the object is a string of four octets. This string totals 32 bits, and position numbers (0-31) correspond to the first 32 control characters. For example, if bit 19 is set to 1, then the ASCII control character 19 (ctrl-s) is sent transparently. Note: Async Control Character Map must be cleared when Multilink is used (value: 00 00 00 00) Range of Values: 4 octets, each character ranging from 00 to FF. Default Value: FFFFFFFF. Configuration Changed: administrative")
